//middelwares
app.use(morgan('dev'));
app.use(json());

//routes
app.use('/api/eventos',eventosRoutes);
app.use('/api/conferencistas', conferencistasRoutes);
app.use('/api/usuarios', usuariosRoutes);




export default app;

