        });
    }*/
}

export async function consultUsuarios(req, res){
    try{
        await usuarios.findAll();
            res.json({
                data: usuarios
            });
    }catch(e){
        res.status(500).json({
            message: 'e'
        })
    }
}

export async function oneUsuario(req, res){
    try{
        const {idUsuario} = request.params;
        const usuario = await usuarios.findOne({
            where:{
                idUsuario
            }
        })
        res.json({
            data: usuario
        })
    }catch(e){
        res.status(500).json({
            message: 'e'
        })
    }
}

export async function consultarLogin(req, res){
    
    const {idusuario, contrasea} = req.body;
    try{
        const tipoUsuario = await usuarios.findOne({
            attributes: ['tipo'],
            where:{
                idusuario,
                contrasea
            }
        });
        if(tipoUsuario){
            return res.send(tipoUsuario);
        }else
             return res.json(null);
    }catch(e){
        console.log(e);
        res.json({
            message: "error",
            data: {}
        });
    }
}

